import React from "react";

export default function ConditionalRenderList({
  value,
  list,
  setValue,
  toggle,
  setToggle,
}) {
  if (value) {
    const filteredList = list.filter((item) => {
      return item.data.toString().toLowerCase().startsWith(value[0]);
    });
  }

  return <div>ConditionalRenderList</div>;
}
